import React, { Component } from 'react';

export default class indentList extends Component {
    render() {
        return (
            <div>
                <Input
                    value={this.state.username}
                    placeholder="用户名"
                    onChange={e =>
                        this.setState({
                            username: e.target.value.trim(),
                        })
                    }
                />
            </div>
        );
    }
}
